{'id': 5435180, 'body': 'Hello,

When your town expands to the size of 2x2, you will be able to create and customize a new town. This can be done by tapping on the lowest button on the left side of the screen. Once you have created a new town you can add decorations, rearrange buildings, and purchase more land. 

Please contact us if you have further questions. :)', 'modified': '2018-10-10T07:03:57Z'}

{'id': 3645562, 'body': 'Hello,

Please go to SleepTown’s settings page and tap the cell with your user name on it. This will lead you to your profile page where you can find the redeem button for “special Forest house”. 

Thanks for contacting us :)', 'modified': '2018-05-30T03:26:02Z'}
